export const baseLayer = {
    id: 'county',
    type: 'fill',
    paint:{
        'fill-color': {
            property: 'rangeValue',
            stops: [
            [0, '#3288bd'],
            [1, '#66c2a5'],
            [2, '#abdda4'],
            [3, '#e6f598'],
            [4, '#ffffbf'],
            [5, '#fee08b'],
            [6, '#fdae61'],
            [7, '#f46d43'],
            [8, '#d53e4f']]
        },
        "fill-opacity": 0.5, 
        "fill-outline-color": "#2e86c1"
    }
};

export const selected = {
    id: 'selected',
    type: 'line',
    paint:{
        "line-opacity": 0.5, 
        "line-color": "#f1c40f",
        "line-width": 3
    }
};
